  (910, 'DSP_WINK_RECEIVED', 'Wink Received'),
  (909, 'DSP_HELP_PAGE_CONTENT', '<p><strong>Home Page</strong> - This is the area that you are directed to when you first login. </p> <br> <p><strong>Happening Graph</strong> - This is what is happening this current week with your profile.</p> <br> <p><strong>Email</strong> - This is where all the emails go when you receive email from other users. From here you can check your Inbox, Sent Items, Deleted Items and Compose. The Compose will show you a dropdown of your Favorite profiles. You can''t send a new email from here. To send a new email just visit a users profile.</p> <br> <p><strong>Online</strong> - Shows the users that are currently online. You can filter the online results by gender.</p> <br> <p><strong>Steal Mode</strong> - Turning Stealth Mode ON will make in invisible to other users.</p> <br> <p><strong>Profile Trending</strong> - These are the profiles that are getting the most attention. You can filter these by Favorites, Friends, Winks Sent and Emails.</p> <br> <p><strong>Who Viewed Me</strong> - These are the profiles that have viewed your profile.</p> <br> <p><strong>Who I Viewed </strong>- These are all the profiles you have viewed.</p> <br> <p><strong>View Profile</strong> - This will show you what your profile looks like to other users.</p> <br> <p><strong>Edit Profile</strong> - This lets you edit your profile and your default photo on your profile.</p> <br> <p><strong>Media</strong> - This is where you add Photo Galleries, Audio and Video files.</p> <br> <p><strong>Chat</strong> - This is the group chat room. </p> <br> <p><strong>One to One Chat</strong> - When a user is online you can send them a Chat request. The other user will receive a popup that ask them if they would like to chat. If they accept it then you''re put into a One on One Chat session.</p> <br> <p><strong>Search</strong> - Search for other profiles.</p> <br> <p><strong>Advanced Search</strong> - Extend the search function by searching for specific things in a profile.</p> <br> <p><strong>Zip Code Search</strong> - Search for profiles from any number of miles from a given zip code.</p> <br> <p><strong>Saved Search</strong> - Save your searches by name so you can access them quickly.</p> <br> <p><strong>Settings / Account </strong>- Change your email address and your password here.</p> <br> <p><strong>Settings / Match Alerts</strong> - These are profile matches that you can have sent to your email automatically. You turn it on and set the criteria.</p> <br> <p><strong>Settings / Blocked </strong>- These are the profiles that you have blocked from contacting you. You can block a user from their profile view.</p> <br> <p><strong>Settings / Privacy</strong> - This is where you set who can contact you. By default, everyone can contact you.</p> <br> <p><strong>Settings / Skype</strong> - If you want to use the Skype Instant Messenger/Chat feature then you just add your Skype name and set who can contact you. Can be everyone or your friends.</p> <br> <p><strong>Settings / Upgrade Account</strong> - Upgrade your account to premium membership to get access to features like Email and Chat.</p> <br> <p><strong>Extras / Trending </strong>- Trending profiles are profiles that are getting the most attention. You can filter these results as well.</p> <br> <p><strong>Extras / Interest Cloud </strong>- When you add Interests to your profile they become searchable via the Interest Cloud area. </p> <br> <p><strong>Extras / Date Tracker</strong> - Track the people that you go out with by using the Date Tracker. On a profile there is a icon for Date Tracker. Click it and then you can keep a diary of how it went with this user.</p> <br> <p><strong>Extras / Blogs</strong> - Write articles in the blog section that will appear on your profile.</p> <br> <p><strong>Extras / Meet Me</strong> - Browse through the member profile base and click the Yes or No button and an email will be sent to that user letting them know that they would like to meet you.</p>'),
