	if ( file_exists( ABSPATH . 'wp-content/plugins/dsp_dating/flags' ) ) {
		chmod( ABSPATH . 'wp-content/plugins/dsp_dating/flags', 0755 );  // chmod it to 777
	}


	return ob_get_clean();
}
